import {BrowserRouter, Route, Routes} from 'react-router-dom';
import './App.css';
import {Header} from "./Header";
import {Card} from "./Card";
import {ManagerList} from "./ManagersList";
import {ClientsList} from "./ClientsList";

const managerList = [
    {
        firstName: 'Дмитрий',
        lastName: 'Рогозин'
    },
    {
        firstName: 'Дмитрий',
        lastName: 'Рогозин'
    },
    {
        firstName: 'Дмитрий',
        lastName: 'Рогозин'
    }
];

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Header>Личный кабинет руководителя банковского отдела</Header>
                <div className="Content">
                    <Routes>
                        <Route path="/" element={
                            <>
                                <Card title="Список менеджеров">
                                    <ManagerList
                                        managerList={managerList}
                                    />
                                </Card>
                                <Card title="Список клиентов">
                                    <ClientsList
                                        clientsList={managerList}
                                    />
                                </Card>
                            </>
                        }/>
                        <Route path="/add/manager" element={
                            <Card title="Добавление менеджера">
                                <ManagerList
                                    managerList={managerList}
                                />
                            </Card>
                        }/>
                        <Route path="/add/client" element={
                            <Card title="Добавление клиента">
                                <ClientsList
                                    clientsList={managerList}
                                />
                            </Card>
                        }/>
                    </Routes>
                </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
